import React from "react";
import {Card, Carousel} from "react-bootstrap";
// import axios from "axios";
import "./card.css";

const Car = (props) => {
return (
  <div> <h4>Place Card Here</h4>
  <Card>
    <Carousel.Item>
      <img
        className="cardBack"
        src="{}"
        alt="Card Back"
      />
    </Carousel.Item>
    <Carousel.Item>
      <img
        className="cardFront"
        src="{}"
        alt="Card Front"
      />
    </Carousel.Item>
  </Card>
  </div>
)
  
}

export default Car;
